CREATE DEFINER=`proxy`@`%` FUNCTION `fun_seq_nextval`(seqName VARCHAR(50)) RETURNS varchar(50) CHARSET utf8
    COMMENT '获得下一个序列号'
BEGIN  
DECLARE curDay VARCHAR(10);
DECLARE currentDay VARCHAR(10);
DECLARE dayDiff VARCHAR(10);

select date_format(curdate(), '%Y%m%d') INTO curDay;
SELECT current_day INTO currentDay FROM SYS_SEQUENCE WHERE seq_name = seqName;
SELECT datediff(curDay, currentDay) INTO dayDiff;

IF dayDiff > 0 THEN 
 UPDATE SYS_SEQUENCE  
       SET current_value = 1 , current_day = curDay
       WHERE seq_name = seqName;

ELSE
	UPDATE SYS_SEQUENCE  
       SET current_value = current_value + increment 
       WHERE seq_name = seqName; 

END IF;

RETURN fun_seq_currval(seqName);  
END ;;
